import React from "react";

//Style Of Component
import "./modificationElementView.scss"


const ModificationElementView = ( { item, listComplete, setListComplete} ) => {




	return( 
      <div className={"modification-element-view"} >  
        <label className="view-table-name"> { item.name } </label>

        <input className="input name" type="text" label={item.description} value={item.description}  onChange={ (event) => listComplete({ ...listComplete, description: event.target.value }) } /> 

        <label  className="view-table-status"> { item.status } </label>
        <button className="button-work delete"  > </button> 
        <button className="button-work modification"  > </button>  
      </div> 
  )
}

export default React.memo(ModificationElementView);
